pragma solidity >=0.5.16 <0.9.0;
pragma experimental ABIEncoderV2;

contract Artist {
    uint public artistID;
    address payable public owner;
    string public name;
    MusicObject[] public collection;
    mapping (uint => MusicObject) public IDtoMusicObject;
    // music object id to IPFS cid
    mapping (uint => uint) private IDToCID;
    uint private idCounter;

    enum Type {Single, EP, Album}

    // 'price' needs to be determined from chainlink oracle
    struct MusicObject {
        uint id;
        bytes32[] songs;
        string title;
        Type objectType;
        uint price;
    }

    uint[] private CIDS;


    modifier isOwner() {
        require(msg.sender == owner);
        _;
    }

    modifier validAmount(uint _paid, uint _id) {
        require(_paid >=  IDtoMusicObject[_id].price);
        _;
    }
    constructor(address payable _owner, uint _artistID, string memory _name) public {
        idCounter = 0;
        owner = _owner;
        artistID = _artistID;
        name = _name;
    }

    // function setName(string memory _newName) public isOwner {
    //     name = _newName;
    // }

    // once the browser has stored the file(s) on IPFS, we'll store the CID with the associated piece of work
    function createMusicObject(bytes32[] memory _songs, string memory _title, Type _type, uint _price, uint _cid) public isOwner {
        MusicObject memory m = MusicObject(idCounter, _songs, _title, _type, _price);
        collection.push(m);
        IDtoMusicObject[idCounter] = m;
        IDToCID[idCounter] = _cid;
        idCounter += 1;
    }

    function getMusicCollection() public view returns(MusicObject[] memory) {
        return collection;
    }

    function purchaseMusicObject(uint id) public payable validAmount(msg.value, id) {
        owner.transfer(msg.value);
        // implement return of ipfs CID for corresponding ID

    }
}
